    const [task,setTask]=useState([]);
  return (
    <div className='Home'>
      <form>
        <input type="text" placeholder='Title'/>
        <textarea placeholder='description'></textarea>
        <button type="submit">ADD</button>
      </form>
      {task.map(()=>(
        <Task/>
      ))}
    </div>
  )
}

export default Home
